import React from "react";
import styles from "./Dialogs.module.css"
import {NavLink} from "react-router-dom";



const Dialog = (proms) => {
    return (
        <div className={styles.dialog}>
            <NavLink to={'/dialogs/' + proms.number}>{proms.name}</NavLink>
        </div>
    )
}


const Dialogs = (proms) => {
    return (
        <div className={styles.dialogs}>
            <div className={styles.dialogsItem}>
                <Dialog name="Alex" number="1"/>
                <Dialog name="Petya" number="2"/>
                <Dialog name="Olga" number="3"/>
                <Dialog name="Vanya" number="4"/>
                <Dialog name="Petya" number="5"/>
                <Dialog name="Tanya" number="6"/>
            </div>
            <div className={styles.messages}>
                <div className={styles.message}>Hello</div>
                <div className={styles.message}>No</div>
                <div className={styles.message}>Yes</div>
            </div>
        </div>
    )
}

export default Dialogs;
